                <script>// script buat lokasi mall based area lokasi yang dipilih
                    document.getElementById('area').addEventListener('change', function() {
                        var area = this.value;
                        var mallSelect = document.getElementById('mall');
                        mallSelect.innerHTML = '<option value="">Pilih Mall</option>'; // 

                        if (area === 'jakarta') {
                            var malls = ['Mall Taman Anggrek', 'Central Park', 'Plaza Indonesia'];
                        } else if (area === 'bandung') {
                            var malls = ['Paris Van Java', 'Trans Studio Mall', 'Cihampelas Walk'];
                        } else if (area === 'surabaya') {
                            var malls = ['Tunjungan Plaza', 'Galaxy Mall', 'Pakuwon Mall'];
                        } else if (area === 'medan') {
                            var malls = ['Sun Plaza', 'Centre Point', 'Plaza Medan Fair'];
                        } else if (area === 'bali') {
                            var malls = ['Beachwalk', 'Discovery Shopping Mall', 'Bali Collection'];
                        } else {
                            var malls = [];
                        }

                        malls.forEach(function(mall) {
                            var option = document.createElement('option');
                            option.value = mall.toLowerCase().replace(/\s+/g, '-');
                            option.textContent = mall;
                            mallSelect.appendChild(option);
                        });
                    });
                </script>
